import styled from 'styled-components'
export const SmallText = styled.p`
    color: white;
    font-size: 1.5rem;
    padding-left: 10px;
    padding-right:10px;
    padding-top: 30px;
`
export const BigText = styled.h1`
    color: white;
    font-size: 2.4rem;
    padding-left: 10px;
    padding-right:10px;
    padding-top: 30px;
`
